  return (
    <Router>
    <Switch>
    <NavBar />
    <header className="App-header">
       <Login1 />
      </header>
    <div className='container'>
    <Route path='/notFound' exact component={notFound}/>
    </div>
    </Switch>
  </Router>


  );
}


<div className="App">
      <header className="App-header">
       <Login1 />
      </header>
    </div>



export default App;
